import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getVisions, deleteVisions } from "../../actions/visions";
import { getClos } from "../../actions/clos";
export class Visions extends Component {
  static propTypes = {
    clos: PropTypes.array.isRequired,
    visions: PropTypes.array.isRequired,
    getVisions: PropTypes.func.isRequired,
    deleteVisions: PropTypes.func.isRequired
  };

  componentDidMount() {
    this.props.getVisions();
    this.props.getClos();
  }
  render() {
    return (
      <Fragment>
        <h2>Vision</h2>
        <table className="table table-stripped">
          <thead>
            <tr>
              <th>MISSION</th>
              <th>GOAL</th>
              <th>OUTCOME</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {this.props.visions.map(vision => (
              <tr key={vision.id}>
                <td>{vision.mission}</td>
                <td>{vision.goal}</td>
                <td>{vision.outcome}</td>
                <td>
                  <button
                    onClick={this.props.deleteVisions.bind(this, vision.id)}
                    className="btn btn-danger btn-sm"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
          <table className="table table-stripped">
            <thead>
              <tr>
                <th>CODE</th>
                <th>DESCRIPTION</th>
                <th />
              </tr>
            </thead>
            <tbody>
              {this.props.clos.map(clo => (
                <tr key={clo.id}>
                  <td>{clo.code}</td>
                  <td>{clo.description}</td>

                  <td>
                    <button
                      onClick={this.props.deleteClos.bind(this, clo.id)}
                      className="btn btn-danger btn-sm"
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </table>
      </Fragment>
    );
  }
}

const mapStateToProps = state => ({
  visions: state.visions.visions,
  clos: state.clos.clos
});
export default connect(mapStateToProps, { getVisions, deleteVisions, getClos })(
  Visions
);
